    gastAtParaList[0].ulParaValue = 1;

    /*输入参数检查*/
    memset(&stAuthdata, 0x00, sizeof(TAF_AUTHDATA_EXT_STRU));

    stAuthdata.ucCid = (TAF_UINT8)gastAtParaList[0].ulParaValue;

    gucAtParaIndex = 5;

    gastAtParaList[1].usParaLen = 1;

    gastAtParaList[1].ulParaValue = 1;

