    stAuthdata.bitOpAuthType= 1;
    stAuthdata.enAuthType = (TAF_PDP_AUTH_TYPE_ENUM_UINT8)gastAtParaList[1].ulParaValue;

    gastAtParaList[2].usParaLen = 5;

    memcpy(gastAtParaList[2].aucPara, "23002", gastAtParaList[2].usParaLen);

