    // 初始化全局变量
    g_stATParseCmd.ucCmdOptType     = AT_CMD_OPT_SET_PARA_CMD;
    gucAtParaIndex                  = 4;

    gastAtParaList[0].ulParaValue   = 123456;
    gastAtParaList[0].usParaLen     = 6;
